import axios from 'axios';
import styles from './Navbar.module.css';
import { useState } from 'react';
import { Link } from 'react-router-dom';
import { Outlet } from "react-router-dom";


export default function Navbar({props}){
        console.log(props.user)
        const handlelogout = async() => {
            const res = await axios.post('http://127.0.0.1:8000/api/users/logout/')
            console.log(res.data)
        }

    return (
        <div>
        <nav className={styles.navBar}>
        <h1>Know Your Health</h1>

       <Link to='/Labs' className={styles.lablink}>Labs</Link>
     {props.user ? <Link to='/Login'> <button className={styles.logbtn}>Login/Signup</button></Link> : <button onClick={handlelogout}>Logout</button>}
        </nav>
        <Outlet />

        </div>
    )
}
